%[text] # Lagrange multipliers
%[text] Find the extreme points of the function $f(x,y)=x^2+y^2$ subject to the constraint $g(x,y)=y^2-x-5=0$
syms x y lambda
f(x,y)=x^2+y^2 %[output:9cc87607]
g(x,y)=y^2-x-5 %[output:4e5ab406]
%[text] now we build the Lagrangian:
L(x,y)=f-lambda*g %[output:1c3db384]
%[text] Finally, we obtain the gradient of the Lagrangian
Lx = diff(L,x)==0 %[output:6987bcca]
Ly = diff(L,y)==0;
%[text] and solve the system of equations
system=[Lx,Ly,g==0] %[output:496054b1]
[xs,ys,lambdas]=solve(system,[x y lambda],"Real",true) %[output:0496b3ab] %[output:818bac8d] %[output:2ca4570a]
%[text] Here a Geogebra representation: [https://www.geogebra.org/classic/PSzG4pe6](https://www.geogebra.org/classic/PSzG4pe6) 
%[text] Or, plotting it with Matlab:
% Create a 3D plot using fsurf for functions f and g
figure; %[output:969de357]
hold on; %[output:969de357]
Min=-5;Max = 5; % Define the maximum range for the plot
fsurf(f, [Min Max Min Max], 'FaceAlpha', 0.2); %[output:969de357]
hold on; %[output:969de357]
fimplicit(g, [Min Max Min Max], 'k', 'LineWidth', 2); %[output:969de357]
fsurf(g, [Min Max Min Max], 'FaceAlpha', 0.8); %[output:969de357]

% Reorient the view for better visualization in 3D
view(45, 60); %[output:969de357]

hold off; %[output:969de357]

% Add labels and title
xlabel('x-axis'); %[output:969de357]
ylabel('y-axis'); %[output:969de357]
zlabel('Function values'); %[output:969de357]
title('3D Plot of Functions f and g'); %[output:969de357]
legend('f(x,y) = x^2 + y^2', 'g(x,y) = y^2 - x - 5'); %[output:969de357]
grid on; %[output:969de357]
